import React from 'react';

import Logo from '../C_login/Logo';
import EmailLogin from '../C_login/EmailLogin';
import CredentialLogin from '../C_login/CredentialLogin';

function Login() {
  
  return (    
    <div class="login">
      <Logo />
      <EmailLogin />
      <CredentialLogin />    
    </div>
  );
}

export default Login;
